function invoke(msg) {

    	var requestId = msg.get("firstapi.requestId");
	var publicKey = msg.get("firstapi.publicKey");
	
	var responseCode = "success"; 
      var message = "";

	if (!requestId) {
		responseCode = "ERR01";
		message = "Request id is required";
	} else if (!publicKey) {
		responseCode = "ERR01";
		message = "Public Key is required";
	} 
	
	msg.put("codeResponse", responseCode);
	msg.put("messageResponse", message);
	msg.put("response.requestId", requestId);
	return true;
}

from java.lang import Boolean
def invoke(msg):
    accessToken = msg.get("oauth.client.accesstoken")
    if accessToken:
        msg.put("authorized", Boolean.TRUE)
    else:
        msg.put("authorized", Boolean.FALSE)

    return True

