import groovy.time.TimeCategory

def invoke(msg)         { 
	long timestamp = System.currentTimeMillis() / 1000L;
	msg.put("iat", timestamp);
      return true;         
}

import groovy.time.TimeCategory

def invoke(msg)         { 
	Date now = new Date();
	use( TimeCategory ) {
          after5Mins = now + 5.minutes
      }
	long exp = after5Mins.getTime() / 1000;
	msg.put("exp", exp);
      return true;         
}
